export default function ControlCard({title}){
    const alertStart = ()=>{
        window.alert('คุณกำลังกด Start' +title);
    };
    const alertRestart = ()=>{
        window.alert('คุณกำลังกด Restart' +title);
    }
    const alertDown = ()=>{
        window.alert('คุณกำลังกด Down' +title);
    }
    return(
       <div>
           <h1> {title} </h1>
           <button className="btn btn-success" onClick={()=>alertStart()}>Start</button>
           <button className="btn btn-warning" onClick={()=>alertRestart()}>Restart</button>
           <button className="btn btn-danger" onClick={()=>alertDown()}>Down</button>
       </div>
    )
   }
